import React from 'react';
import classes from './profile.module.css';
import Profile from './profile';
class ProfileContainer extends React.Component {
    render () {
    return (
        <div className={classes.wrapper}>
            <Profile {...this.props}/>
        </div>
    )
    }
}
export default ProfileContainer;
